    # public utils
    def get_name_code_dict(self):
        """
        得到fullname_code_dict
        """
        fullname_code_dict = {}
        for code, abbr_full in self.code_abbr_full_dict.items():
            if abbr_full[1] in fullname_code_dict:
                fullname_code_dict[abbr_full[1]] = "{0}|{1}".format(fullname_code_dict[abbr_full[1]], code)
            else:
                fullname_code_dict[abbr_full[1]] = str(code)    # 不是repr(code)
        print(fullname_code_dict)

    # public utils
    def get_name_comid(self):
        """
        得到fullname_id.md
        """
        f1 = open("fullname_id.md", "w")
        with open("./keep_tianyancha_json.md") as f:
            while 1:
                line = f.readline()
                if not line:
                    break
                line = line.strip()
                line_list = line.split()
                if len(line_list) == 3:
                    temp = line_list[1].replace("（", "(").replace("）", ")")
                    if temp != line_list[0]:
                        f1.write("{0}\tlxw_{1}\t{2}\n".format(line_list[0], temp, line_list[2]))
                    else:
                        f1.write("{0}\t{1}\n".format(temp, line_list[2]))
                else:
                    f1.write("{0}\t{1}\n".format(line_list[0], line_list[1]))
        f1.close()

    # public utils
    def get_name_comid_dict(self):
        """
        得到fullname_id_dict
        """
        name_comid_dict = {}
        with open("./fullname_id.md") as f:
            while 1:
                line = f.readline()
                if not line:
                    break
                line = line.strip()
                line_list = line.split()
                if len(line_list) == 3:
                    name_comid_dict[line_list[0]] = line_list[2]
                else:
                    name_comid_dict[line_list[0]] = line_list[1]
        print(name_comid_dict)

