    def get_patent(self, comid, pn, code):
        """
        :param comid: 天眼查自定义的公司id 
        :param pn: 页码. int
        :param code: 公司代码
        :return: str
        第2)步可以通过浏览器直接访问, 也可以通过requests构建请求进行爬取
        """
        try:
            url = "http://www.tianyancha.com/expanse/patent.json?id={0}&pn={1}&ps=5000".format(comid, pn)
            headers = {"User-Agent": "Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0)"}
            resp = requests.get(url=url, headers=headers)
            content = resp.text
            content_dict = json.loads(content)
            if content_dict["state"] != "ok":
                return
            data_dict = content_dict["data"]
            data_dict["com_code"] = code
            data_dict["pn"] = pn
            self.into_mongo(data_dict, "tyc_patent")
            self.get_copyreg(comid, pn+1, code)
        except Exception as e:
            self.tyc_error_logger.error("\n\n{0}\nlxw_{1}_{2}_{3}\nin get_patent(). Exception:{4}".format("--"*30, comid, pn, code, e))

