    def get_icp(self, comid, code):
        """
        :param comid: 天眼查自定义的公司id 
        :param code: 公司代码
        :return: str
        第2)步可以通过浏览器直接访问, 也可以通过requests构建请求进行爬取
        """
        try:
            url = "http://www.tianyancha.com/v2/IcpList/{0}.json".format(comid)
            headers = {"User-Agent": "Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0)"}
            resp = requests.get(url=url, headers=headers)
            content = resp.text
            content_dict = json.loads(content)
            if content_dict["state"] != "ok":
                return
            content_dict["com_code"] = code
            if "state" in content_dict:
                del content_dict["state"]
            if "message" in content_dict:
                del content_dict["message"]
            if "special" in content_dict:
                del content_dict["special"]
            if "vipMessage" in content_dict:
                del content_dict["vipMessage"]
            if "isLogin" in content_dict:
                del content_dict["isLogin"]
            self.into_mongo(content_dict, "tyc_icp")
        except Exception as e:
            self.tyc_error_logger.error("\n\n{0}\nlxw_{1}_{2}\nin get_icp(). Exception:{3}".format("--"*30, comid, code, e))

